import React from "react";

const Home = () => {
  const heroSlides = [
    {
      title: "Slide 1",
      subtitle: "Slide 1 subtitle",
      image: "https://picsum.photos/200/300",
    },
    {
      title: "Slide 2",
      subtitle: "Slide 2 subtitle",
      image: "https://picsum.photos/200/300",
    },
    {
      title: "Slide 3",
      subtitle: "Slide 3 subtitle",
      image: "https://picsum.photos/200/300",
    },
  ];

  return (
    <div className="page home">
      <div className="hero">hero</div>
    </div>
  );
};

export default Home;
